Yeah, buoy!

Today, the Coast Guard hosted the Buoy Tender Olympics in Juneau, Alaska. This event is designed to build morale among unit members and provides a fun way to train.

The contests included a chain pull, line toss, survival swim, tug of war, and heat and beat.

This event is a part of the Buoy Tender Roundup. What’s the Roundup? Great question! This meeting is an excellent way to ensure buoy tender crews learn the best practices for maintaining aids to navigation, as well as gaining hands-on experience.

Did you know: The Coast Guard maintains over 47,000 floating aids throughout the country, including our inland rivers…These aids ensure the maritime transportation system remains a safe and effective way to transport goods by water.

Buoy tending is inherently dangerous and this gathering is a fantastic way to safely learn how to service the numerous floating and fixed aids we regulate.

